import React, { useState } from 'react';
import {
  Container,
  Grid,
  Card,
  CardMedia,
  CardContent,
  CardActions,
  Typography,
  Button,
  Tabs,
  Tab,
  Box,
  Snackbar,
  Alert,
} from '@mui/material';

const juiceCategories = {
  beauty: [
    {
      id: 'b1',
      name: 'Glowing Skin',
      description: 'Beetroot, Carrot, Apple, and Ginger',
      price: '$6.99',
      image: 'https://source.unsplash.com/400x300/?beetroot-juice',
    },
    {
      id: 'b2',
      name: 'Hair Health',
      description: 'Aloe Vera, Amla, and Spinach',
      price: '$7.99',
      image: 'https://source.unsplash.com/400x300/?green-smoothie',
    },
  ],
  tasty: [
    {
      id: 't1',
      name: 'Mango Tango',
      description: 'Fresh Mango with a hint of Mint',
      price: '$5.99',
      image: 'https://source.unsplash.com/400x300/?mango-juice',
    },
    {
      id: 't2',
      name: 'Berry Paradise',
      description: 'Mixed Berries with Apple base',
      price: '$6.99',
      image: 'https://source.unsplash.com/400x300/?berry-smoothie',
    },
  ],
  indian: [
    {
      id: 'i1',
      name: 'Sweet Lassi',
      description: 'Traditional Yogurt drink with Cardamom',
      price: '$4.99',
      image: 'https://source.unsplash.com/400x300/?lassi',
    },
    {
      id: 'i2',
      name: 'Masala Chaas',
      description: 'Spiced Buttermilk with Mint and Cumin',
      price: '$3.99',
      image: 'https://source.unsplash.com/400x300/?buttermilk',
    },
  ],
};

function Menu() {
  const [category, setCategory] = useState('beauty');
  const [showSnackbar, setShowSnackbar] = useState(false);

  const handleCategoryChange = (event, newValue) => {
    setCategory(newValue);
  };

  const handleAddToCart = () => {
    setShowSnackbar(true);
  };

  return (
    <Container sx={{ py: 4 }}>
      <Typography variant="h3" component="h1" gutterBottom textAlign="center">
        Our Menu
      </Typography>

      <Box sx={{ borderBottom: 1, borderColor: 'divider', mb: 4 }}>
        <Tabs
          value={category}
          onChange={handleCategoryChange}
          centered
          textColor="primary"
          indicatorColor="primary"
        >
          <Tab label="Beauty Juices" value="beauty" />
          <Tab label="Tasty Juices" value="tasty" />
          <Tab label="Indian Specials" value="indian" />
        </Tabs>
      </Box>

      <Grid container spacing={4}>
        {juiceCategories[category].map((juice) => (
          <Grid item xs={12} sm={6} md={4} key={juice.id}>
            <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
              <CardMedia
                component="img"
                height="200"
                image={juice.image}
                alt={juice.name}
              />
              <CardContent sx={{ flexGrow: 1 }}>
                <Typography gutterBottom variant="h5" component="h2">
                  {juice.name}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {juice.description}
                </Typography>
                <Typography variant="h6" color="primary" sx={{ mt: 2 }}>
                  {juice.price}
                </Typography>
              </CardContent>
              <CardActions>
                <Button
                  size="small"
                  variant="contained"
                  color="primary"
                  fullWidth
                  onClick={handleAddToCart}
                >
                  Add to Cart
                </Button>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>

      <Snackbar
        open={showSnackbar}
        autoHideDuration={3000}
        onClose={() => setShowSnackbar(false)}
      >
        <Alert
          onClose={() => setShowSnackbar(false)}
          severity="success"
          sx={{ width: '100%' }}
        >
          Item added to cart!
        </Alert>
      </Snackbar>
    </Container>
  );
}

export default Menu;
